import React from 'react';
import { Link, NavLink } from 'react-router-dom';
import '../styles/global.css';
import logo from '../assets/bttf-logo.png';

const NavBar = () => {
  return (
    <nav className="navbar">
        <Link to="/" className="navbar-logo"><img src={logo} alt="logo"/></Link>
        <NavLink to="/" className="navbar-buttonk">Home</NavLink>
        <NavLink to="/application" className="navbar-button">+ Open Account</NavLink>
    </nav>
  );
};

export default NavBar;
